import React,{useEffect,Fragment} from 'react'
import "./Filter.css";

const Filter = ({ langs, active, onClickHandler }) => {
  let navbar="<div className='col-xs-12 navbar nav-justified'><ul className='nav-justified'>";
  const btnFilter = langs.map(lang => {
      <li className='nav-justified'><button
        key={lang}
        onClick={() => onClickHandler(lang)}
        className={active === lang ? "active" : ""}
      >
        {lang}
      </button>
      </li>

  });
  navbar+=btnFilter+"</ul><hr></div> ";
  return navbar;
  //return <div>{btnFilter}</div>;
};

export default Filter;
